import React from "react";
import Link from "next/link";
import Image from "next/image";

export default function projects() {
  return (
    <div className="container">
      <header>
        <style jsx>
          {`
            ul {
              list-style-type: none;
              margin-right: 2rem;
            }

            a {
              float: right;
              color: blue;
              text-align: center;
              padding: 10px;
              text-decoration: none;
              font-size: 20px;
              line-height: 35px;
              border-radius: 4px;
              display: block;
            }

            header {
              overflow: hidden;
              background-color: lightblue;
              position: fixed;
              top: 0;
              width: 100%;
              float: right;
              padding: 5px 5px;
            }
          `}
        </style>
        <style jsx global>{`
          body {
            background: lightblue;
          }

          .bugs {
            text-align: center;
            padding: 5%;
          }

          .flex-container2 {
            display: flex;
            flex-direction: row;  
            width: 100%;
            font-size: 20px;
            padding: 3%;

          }

          .flex-item-left2 {
            background-color: lightblue;
            flex: 50%;
            padding: 10px;
            border: 2px solid red;
            border-radius: 12px;
          }

          .flex-item-right2 {
            background-color: lightblue;
            flex: 50%;
            padding: 10px;
            border: 2px solid red;
            border-radius: 12px;
          }
        `}</style>
        <nav>
          <ul>
            <Link href="/contact">
              <a>Contact</a>
            </Link>
            <Link href="/projects">
              <a>Projects</a>
            </Link>
            <Link href="/about">
              <a>About Me</a>
            </Link>
            <Link href="/">
              <a>Home</a>
            </Link>
          </ul>
        </nav>
      </header>
      <div className="bugs">
        <Image
          src="/static/bugs.svg"
          alt=""
          width={500}
          height={500}
          className="bugs"
        />
      </div>
      <div className="flex-container2">

        <div className="flex-item-left2">
          <h4>Javascript Calculator</h4>

          <p>
            I created this calculator with vanilla JavaScript, HTML and CSS for
            my task during my bootstrap with hyperionDev
          </p>

          <a
            href="https://testcalculator.netlify.app/"
            className="button button2"
            target="blank"
          >
            Click Here
          </a>
        </div>
      </div>

      <div className="flex-item-right2">
        <h4> Online Store</h4>
        <p className="">
          This is a online store with add to cart functionality, you can add
          items to cart and remove it at will.
        </p>
        <a
          href="https://testonlinestore.netlify.app/"
          className="button button1"
          target="blank"
        >
          Click Here
        </a>
      </div>
    </div>
  );
}
